// import React from "react"
import ReactDOM from "react-dom/client"
import "./style.css"




const root=ReactDOM.createRoot(document.getElementById("root"))


  //navbar component
  function Navbar(){
    return(
      <nav>
        <h1>Perfumy</h1>
        <ul>
          <li>Home |</li>
          <li>Product |</li>
          <li>About |</li>
          <li>Contact |</li>

        </ul>
      </nav>

  )}

  //search components

  function Search(){
    return(
      <div className="Search">
        <input type="text" placeholder="search"/>       

      </div>
    )
  }



  //products components
  function Products(){
    return(
   <div className="products">

    <div className="box">
        <img src="./images/one.jpg" alt="hero"/>
        <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>    
    </div>

    <div className="box">
        <img src="./images/two.jpg" alt="villain"/>
        <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p> 
    </div>

    <div className="box">
        <img src="./images/three.jpg" alt="Designs Club"/>
        <p>Designer Club-Be Spoke by Perfume Lounge Men's Perfume | Premium Long Lasting Perfume</p>
    </div>

</div>

       ) }

  root.render(
    <div>
      <Navbar/>
      <Search/>
      <Products/>
    </div>


  )
